import React from 'react';
import { Link } from '@reach/router';

const Nav = () => {
	return (
		<nav>
			<Link to="/">Home.</Link>
			<Link to="/football">Football Articles.</Link>
			<Link to="/food">Food Articles.</Link>
			<Link to="/coding">Coding Articles.</Link>
		</nav>
	);
};
export default Nav;
